contracts/Patient.sol.content:
pragma solidity ^0.8.0;

library Patient {
    struct PatientDetails {
        address patientAddress;
        string firstName;
        string lastName;
        uint age;
    }

    function createPatient(address patientAddress, string memory firstName, string memory lastName, uint age) public returns (PatientDetails memory) {
        return PatientDetails(patientAddress, firstName, lastName, age);
    }

    function readPatient(PatientDetails memory patient) public view returns (address, string memory, string memory, uint) {
        return (patient.patientAddress, patient.firstName, patient.lastName, patient.age);
    }
}

